import React, { useEffect, useState } from 'react';
import { View, Text, Image, TouchableOpacity, StyleSheet, Modal, FlatList } from 'react-native';
import axios from 'axios';
import NavBar from '../components/navBar.jsx'

export default function AdivinarPersonaje({ route, navigation }) {
  const [modalVisible, setModalVisible] = useState(false);
  const [user, setUser] = useState({
    mail: null,
    password: null,
  });
  const [personajes, setPersonajes] = useState([]);

  useEffect(() => {
    const storedMail = localStorage.getItem('mail');
    const storedPass = localStorage.getItem('pass');
    setUser({ mail: storedMail, password: storedPass });
  }, []);


  return (
    <View style={styles.container}>
      <NavBar />
      <View style={{display:'flex', alignItems:'center', margin:'20px'}}>
        <Text style={{color:'white', fontSize:'25px'}}>Bienvenido a adivinar el personaje!</Text>
        <Text style={{color:'white', fontSize:'15px'}}>Cuando usted apriete comenzar. El tiempo arrancara y 30 segundos para adivinar la mayor cantidad de personajes</Text>

      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'black',
  },
});
